import React, { Component } from 'react';

class Item extends Component {
    render () {
        return (
            <div>
                <p>{this.props.item.name}</p>
                <p>{this.props.item.weight}</p>
                <p>{this.props.item.exerciseID}</p>
            </div>
        )
    }

}

export default Item;
